import React from 'react'

export default function Dropdown(props) {
  return (
    <>
        <div className="dropdown me-4">
            <button className="btn btn-sm btn-green text-white dropdown-toggle" type="button" id={props.id} data-bs-toggle="dropdown" aria-expanded="false">
             { props.name }
            </button>
            <ul className="dropdown-menu" aria-labelledby={props.id}>
                { props.list.map((project) => <li><button onClick={props.onClick} className="dropdown-item"> {project.name} </button></li>) }
            </ul>
        </div>
    </>
  )
}
